(29, 7, 'DIRECTOR', '2020-09-01', '2025-09-01', '5', NULL, '	Planning menus\r\n	Weekly, monthly and annual financial reporting\r\n	Ensuring compliance with licensing, hygiene and health and safety legislation/guidelines\r\n	Promoting and marketing the business\r\n	Overseeing stock levels\r\n	Ordering supplies\r\n	Coordinating and optimizing front- and back-of-house restaurant operations.\r\n	Controlling operational costs and promoting efficiency.\r\n	Agreeing and managing budgets\r\n	Producing staff roaster\r\n	Handling customer enquiries and complaints\r\n	Taking reservations\r\n	Greeting and advising customers\r\n	Problem solving\r\n	Preparing and presenting staffing/sales reports\r\n	Keeping statistical and financial records\r\n	Assessing and improving profitability\r\n	Setting targets\r\n	Handling administration and paperwork\r\n	Liaising with customers, employees, suppliers, licensing authorities and sales representatives\r\n	Making improvements to the running of the business and developing the restaurant.', '2023-06-10 06:43:53', '2023-06-10 06:43:53'),
(60, 8, 'HEAD WAITER', '2021-05-01', '2024-05-01', '2', NULL, '	Thorough menu knowledge (both food and beverage) \r\n	In depth knowledge of service and food and drinks standards including all steps of service \r\n	Show your experience and ability to manage large sections of guests during busy periods to deliver an impeccable level of service and attention to detail\r\n	Inspire your team to deliver the owners vision, to bring a unique and immersive dining experience to our guests\r\n	Demonstrate an in-depth knowledge of food and beverage and understanding customers specific needs to deliver a unique experience\r\n	In depth till system knowledge \r\n	Good knowledge of how kitchen/bar screens operate \r\n	In depth alcohol policy knowledge \r\n	Good understanding of health and safety policies in the workplace \r\n	Training and development of staff\r\n	Oversee other Floor Staff and highlight any knowledge gaps they may have', '2023-06-21 16:08:58', '2023-06-21 16:08:58'),
(61, 9, 'WAITER', '2021-05-01', '2024-05-01', '2', NULL, '	Provide the perfect service experience for every Guest\r\n	Ensure the Guest feels important and welcome in the restaurant\r\n	Ensure hot food is hot and cold food is cold\r\n	Adhere to timing standards for products and services\r\n	Look for ways to consolidate service and increase table turns\r\n	Present menu, answer questions and make suggestions regarding food and beverage\r\n	Serve the Guest in an accommodating manner\r\n	Apply positive suggestive sales approach to guide Guests\r\n	Pre-bus tables; maintain table cleanliness, bus tables\r\n	Looks for ways to avoid waste and limit costs\r\n	Assist in keeping the restaurant clean and safe\r\n	Provide responsible service of alcoholic beverages\r\n	Deliver food and beverages to any table as needed\r\n	Must follow all cash handling policies and procedures\r\n	Report to property on time and in proper uniform', '2023-06-22 10:42:33', '2023-06-22 10:42:33'),
