(5, '001', 'DIRECTOR', 'MANAGEMENT', '<ul>\r\n	<li>Planning menus</li>\r\n	<li>Weekly, monthly and annual financial reporting</li>\r\n	<li>Ensuring compliance with licensing, hygiene and health and safety legislation/guidelines</li>\r\n	<li>Promoting and marketing the business</li>\r\n	<li>Overseeing stock levels</li>\r\n	<li>Ordering supplies</li>\r\n	<li>Coordinating and optimizing front- and back-of-house restaurant operations.</li>\r\n	<li>Controlling operational costs and promoting efficiency.</li>\r\n	<li>Agreeing and managing budgets</li>\r\n	<li>Producing staff roaster</li>\r\n	<li>Handling customer enquiries and complaints</li>\r\n	<li>Taking reservations</li>\r\n	<li>Greeting and advising customers</li>\r\n	<li>Problem solving</li>\r\n	<li>Preparing and presenting staffing/sales reports</li>\r\n	<li>Keeping statistical and financial records</li>\r\n	<li>Assessing and improving profitability</li>\r\n	<li>Setting targets</li>\r\n	<li>Handling administration and paperwork</li>\r\n	<li>Liaising with customers, employees, suppliers, licensing authorities and sales representatives</li>\r\n	<li>Making improvements to the running of the business and developing the restaurant.</li>\r\n</ul>', 'Enable', '2023-06-09 09:14:34', '2023-06-09 10:21:13', 2),
(6, '1223', 'MANAGER', 'MANAGEMENT', '<ul>\r\n	<li>Coordinating and optimizing front- and back-of-house restaurant operations</li>\r\n	<li>Controlling operational costs and promoting efficiency</li>\r\n	<li>Weekly, monthly and annual financial reporting</li>\r\n	<li>General administration</li>\r\n	<li>Taking reservations</li>\r\n	<li>Troubleshooting</li>\r\n	<li>Greeting and advising customers</li>\r\n	<li>Delivering F&amp;B service to satisfy customer expectations</li>\r\n	<li>Fostering positive customer relations</li>\r\n	<li>Dealing with customer inquiries and complaints</li>\r\n	<li>Recruiting, training and supervising staff</li>\r\n	<li>Managing the staff rota</li>\r\n	<li>Conducting performance appraisals and setting targets</li>\r\n	<li>Optimizing workflow and productivity</li>\r\n	<li>Researching dishes and planning menus</li>\r\n	<li>Keeping abreast of inventory and ordering supplies</li>\r\n	<li>Monitoring product quality and handling vendors</li>\r\n	<li>Ensuring compliance with licensing, health and safety regulations</li>\r\n	<li>Maintain high standards of quality control, hygiene, and safety</li>\r\n	<li>Establishing and implementing policies and protocols that will maintain future restaurant operations</li>\r\n	<li>Proactively fostering the restaurant&rsquo;s imageendeavoring to expand the restaurant&rsquo;s reach through targeted promotions</li>\r\n</ul>', 'Enable', '2023-06-09 09:46:21', '2023-06-09 09:46:21', 2),
(7, '5434', 'HEAD CHEF', 'KITCHEN', '<ul>\r\n	<li>Directing the food preparation process and delegating tasks</li>\r\n	<li>Cooking and preparing high quality dishes</li>\r\n	<li>Assisting the Head Chef to create menu items, recipes and develop dishes</li>\r\n	<li>Supervising all kitchen stations</li>\r\n	<li>Supervising, motivating and working closely with other Chefs of all levels</li>\r\n	<li>Being responsible for health and safety</li>\r\n	<li>Being responsible for food hygiene practices&nbsp;</li>\r\n	<li>Ensuring food quality and excellent standards are maintained for all dishes created</li>\r\n	<li>Assisting with determining food inventory needs, stocking and ordering</li>\r\n	<li>Ensuring the kitchen meets all regulations including sanitary and food safety guidelines</li>\r\n</ul>', 'Enable', '2023-06-09 09:50:46', '2023-06-09 09:50:46', 2),
(8, '5434', 'TANDOORI COOK', 'KITCHEN', '<ul>\r\n	<li>Develop and plan menus and daily specials.</li>\r\n	<li>Improvise menu for Indian Traditional Tandoori food.</li>\r\n	<li>Responsible for both flavor and presentation, aiming to ensure that the food that leaves the kitchen not only tastes great but also looks appealing and appetizing.</li>\r\n	<li>Modify recipes to meet customer&rsquo;s needs and request.</li>\r\n	<li>Experiment with recipes and suggest new ingredients.</li>\r\n	<li>Selects choice ingredients that will give dishes the best flavor.</li>\r\n	<li>Responsible for cooking operations and for coordinating the work of the entire kitchen crew.</li>\r\n	<li>Maintain the schedule for all kitchen staff.</li>\r\n	<li>Tandoori chefs specialize in cooking with a tandoor, an Indian-style oven, using special sauces and spices.</li>\r\n	<li>In addition to creating and preparing dishes, tandoori chefs must interact with restaurant staff and customer and need business skills to order supplies, establish budgets and set prices.</li>\r\n	<li>Monitoring portion and waste control to maintain profit margins.</li>\r\n</ul>', 'Disable', '2023-06-09 09:52:01', '2023-06-09 09:52:01', 2),
(9, '5434', 'TRAINEE SOUS CHEF', 'KITCHEN', '<ul>\r\n	<li>Ensure consistent and smooth running of food production</li>\r\n	<li>Ensure effective stock purchase, its receipt and storage</li>\r\n	<li>Ensure that working areas are always kept clean</li>\r\n	<li>Assist other kitchen staff as need arises</li>\r\n	<li>Supervise performance of kitchen staff to ensure proper activity</li>\r\n	<li>Perform other administrative tasks as will be communicated by superiors</li>\r\n	<li>Ensure that required standards are adhered to in the production and preparation of food &ndash; in quality, quantity and safety</li>\r\n	<li>Work towards exceeding customer&rsquo;s expectation by encouraging and promoting high level of service</li>\r\n	<li>Ensure all complaints, inquiries, and suggestions by customers are attended to accordingly</li>\r\n	<li>Give appropriate support or guidance to members of kitchen when need arises</li>\r\n	<li>Resolve possible disputes within the kitchen and report any unresolved</li>\r\n	<li>Promote good team spirit regularly</li>\r\n	<li>Ensure all dishes are prepared according to specification and served at the correct quality, portion size, and temperature</li>\r\n	<li>Partly responsible for the preparation of kitchen cleaning rosters and the supervision of cleaning schedules</li>\r\n	<li>Prepare substitute items</li>\r\n	<li>Ensure that the kitchen staff work harmoniously in order to ensure timely production of quality foods</li>\r\n	<li>Ensure proper arrangement and garnishing of food</li>\r\n	<li>Manage food logs</li>\r\n	<li>Monitor the quality and quantity of food prepared</li>\r\n	<li>Assist in recruiting, hiring, and training employee cooks</li>\r\n	<li>Report the need for maintenance to appropriate staff</li>\r\n</ul>', 'Disable', '2023-06-09 09:53:41', '2023-06-09 09:53:41', 2),
(10, '5434', 'SOUS CHEF', 'KITCHEN', '<ul>\r\n	<li>Directing the food preparation process and delegating tasks</li>\r\n	<li>Cooking and preparing high quality dishes</li>\r\n	<li>Assisting the Head Chef to create menu items, recipes and develop dishes</li>\r\n	<li>Supervising all kitchen stations</li>\r\n	<li>Supervising, motivating and working closely with other Chefs of all levels</li>\r\n	<li>Being responsible for health and safety</li>\r\n	<li>Being responsible for food hygiene practices&nbsp;</li>\r\n	<li>Ensuring food quality and excellent standards are maintained for all dishes created</li>\r\n	<li>Assisting with determining food inventory needs, stocking and ordering</li>\r\n	<li>Ensuring the kitchen meets all regulations including sanitary and food safety guidelines</li>\r\n</ul>', 'Enable', '2023-06-09 12:46:47', '2023-06-09 12:46:47', 2),
