INSERT INTO `menus` (`id`, `name`, `meta_title`, `meta_keywords`, `meta_des`, `image`, `status`, `created_at`, `updated_at`, `slug`, `body`) VALUES
(1, 'Home', 'Simplify UKHRCLOUD Compliance with Our Sponsorship Management Platform', 'uk hr cloud', 'Optimize UK HR with our intuitive software. Streamline processes, boost productivity, and enhance employee engagement. Your HR transformation starts here.', 'attapoll.20230916145215.jpg', 'Disable', '2023-05-29 18:55:08', '2023-10-02 05:08:28', 'home', NULL),
(2, 'About', 'Get To Know About UK HR Cloud', 'About', 'Streamline your HR processes with our powerful HRM software. Manage employee data, track attendance, automate payroll, and enhance workforce efficiency. Discover a seamless solution for talent management and HR analytics. Try our HRM software today and take your human resources management to the next level', '20230916152311.jpg', 'Enable', '2023-05-31 13:43:10', '2023-09-16 15:23:11', 'about', '<p>HRMS stands for &quot;Human Resource Management System.&quot; It is a software solution designed to help organizations manage and streamline various human resource functions and processes efficiently. HRMS software provides a centralized platform that automates and integrates essential HR tasks, making it easier for HR professionals to handle employee-related activities.</p>'),
(3, 'Service', 'Streamlined Sponsor Licence, Complain, HR File Preparation  Services', 'Sponsor Licence, complain, HR File Preparation', 'Experience seamless Sponsor Licence application, comprehensive compliance, and meticulous HR file preparation services. Your pathway to success starts here', NULL, 'Enable', '2023-05-31 13:43:29', '2023-10-04 02:08:36', 'service', NULL),
(4, 'Contact', 'Unlock UKhrcloud HRMS Solutions: Inquire Now for Expert Guidance. Connect with Us Today!', 'Contact', 'Have a question or need assistance? Feel free to reach out to us. We\'re here to help .Feel free to customize this according to your specific needs and add any additional information you want to include!', NULL, 'Enable', '2023-05-31 13:46:03', '2023-10-04 02:11:33', 'contact', NULL),
