(6, 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', NULL, 'Disable', '2023-06-02 07:46:58', '2023-08-01 09:44:27', 'privacy-policy', '<p>Welcome to UK HR CLOUD- HRM Software. We are committed to protecting the privacy of our users and maintaining the security of their personal information. This Privacy Policy outlines how we collect, use, disclose, and safeguard your data when you use our HRM software.</p>\r\n\r\n<p>Please take the time to read this policy carefully to understand our practices regarding your personal information. By using our Service, you agree to the terms of this Privacy Policy.</p>\r\n\r\n<p>Information We Collect<br />\r\nWe may collect various types of information from you or about you, including but not limited to:</p>\r\n\r\n<p>Personal Information: This includes data that can identify you as an individual, such as your name, contact details, email address, and job title.</p>\r\n\r\n<p>HR Data: We may collect and store information about employees or individuals you manage within the HRM software, such as employment history, performance reviews, attendance records, and salary details. We treat this data with utmost confidentiality.</p>\r\n\r\n<p>Usage Information: We may automatically collect information about your interactions with our Service, including IP address, device information, operating system, and browser type.</p>\r\n\r\n<p>How We Use Your Information<br />\r\nWe use the information collected for the following purposes:</p>\r\n\r\n<p>To provide and improve our HRM software platform and related services.<br />\r\nTo personalize your user experience and ensure content is relevant to you.<br />\r\nTo communicate with you regarding updates, changes, and important announcements.<br />\r\nTo respond to your inquiries and support requests.<br />\r\nTo comply with legal obligations or enforce our rights and agreements.<br />\r\nData Sharing and Disclosure<br />\r\nWe may share your information with the following parties:</p>\r\n\r\n<p>Third-Party Service Providers: We may engage third-party companies or individuals to perform tasks on our behalf, such as data hosting or customer support.</p>\r\n\r\n<p>Business Transfers: If we undergo a merger, acquisition, or sale of all or a portion of our assets, your information may be transferred to the acquiring entity.</p>\r\n\r\n<p>Legal Requirements: We may disclose your information when required by law, regulation, or a court order.</p>\r\n\r\n<p>Data Security<br />\r\nWe implement industry-standard security measures to protect your personal information from unauthorized access, alteration, disclosure, or destruction. However, please understand that no method of data transmission over the internet or electronic storage is 100% secure.</p>\r\n\r\n<p>Your Choices<br />\r\nYou have the right to access, correct, or delete your personal information in accordance with applicable laws. If you wish to exercise these rights or have any questions about our privacy practices, please contact us at info@ukhrcloud.com.</p>\r\n\r\n<p>Updates to the Privacy Policy<br />\r\nWe may update this Privacy Policy from time to time. We will notify you of any significant changes by posting the revised policy on our website or through other appropriate communication channels.</p>\r\n\r\n<p>Contact Us<br />\r\nIf you have any questions, concerns, or comments about this Privacy Policy or our data practices, please contact us at info@ukhrcloud.com</p>\r\n\r\n<p>UK HR CLOUD<br />\r\n49 Wilmslow Road, M14 5TB, Manchester<br />\r\nhttps://ukhrcloud.com/</p>'),
